def next_higher(n):
    print(str(n)[:-2:-1])
    num_bin=bin(n)[2:]
    print(num_bin)
    if num_bin.count('0') == 1 and num_bin[:-2:-1]=='0':
        num_bin='100'+'1'*(len(num_bin)-2)
    elif num_bin.count('0')==0:
        num_bin = '10' + '1' * (len(num_bin) - 1)
    elif num_bin.count('1')==1:
        num_bin=num_bin+'0'
    else:
        key=num_bin.rfind('01')
        one = num_bin[key + 2:].count('1')
        if key==-1:
            num_bin='1'+'0'*(len(num_bin)-one)+'1'*one
        else:
            num_bin=(num_bin[0:key]+'1'+'0'*(len(num_bin)-key-one-1)+'1'*one)
    print(num_bin)
    return int(num_bin,2)




number=201326592
result=next_higher(number)
print(result)